// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./CodeMavricksNft.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract CodeMavericksMarketPlace {
    CodeMavricksNft public nftContract;

    // Keep track of the NFT owners
    mapping(uint256 => uint256) private _tokenPrices;
    mapping(uint256 => bool) private _tokensForSale;

    constructor(address _nftContract) {
        nftContract = CodeMavricksNft(_nftContract);
    }

    modifier onlynotforsale(uint256 tokenId) {
        require(!_tokensForSale[tokenId], "token for sale");
        _;
    }

    function buyNFT(uint256 tokenId) public payable {
        require(nftContract.tokenExists(tokenId), "Token does not exist");
        require(_tokensForSale[tokenId], "Token is not for sale");
        require(
            msg.value >= _tokenPrices[tokenId],
            "Incorrect amount of Ether sent"
        );

        address tokenOwner = nftContract.ownerOf(tokenId);
        //check if the owner owns an nft or no
        require(
            nftContract.balanceOf(msg.sender) == 0,
            "only one nft per user"
        );
        require(tokenOwner != msg.sender, "Cannot buy your own token");

        _tokensForSale[tokenId] = false;
        nftContract.safeTransferFrom(tokenOwner, msg.sender, tokenId, "");

        // Transfer the payment to the token owner
        (bool success, ) = tokenOwner.call{value: msg.value}("");
        require(success, "Transfer failed");
        //remove the old owner from the old structures

        nftContract.setScore(msg.sender, nftContract.getScore(tokenOwner));
        nftContract.setScore(tokenOwner, 0);

        //The contributions should also be transfered
        nftContract.transferNFTContributions(tokenOwner, msg.sender);
    }

    function sellNFT(uint256 tokenId, uint256 price) public {
        require(nftContract.tokenExists(tokenId), "Token does not exist");
        require(
            msg.sender == nftContract.ownerOf(tokenId),
            "Not the token owner"
        );

        _tokenPrices[tokenId] = price;
        _tokensForSale[tokenId] = true;
    }

    function removeSale(uint256 tokenId) public {
        require(nftContract.tokenExists(tokenId), "Token does not exist");
        require(
            msg.sender == nftContract.ownerOf(tokenId),
            "Not the token owner"
        );

        _tokensForSale[tokenId] = false;
    }

    function getNFTsForSale() public view returns (uint256[] memory) {
        uint256[] memory tokenIds = new uint256[](nftContract.totalSupply());
        uint256 tokenCount = 0;

        for (uint256 i = 0; i < nftContract.totalSupply(); i++) {
            if (_tokensForSale[i] == true) {
                tokenIds[tokenCount] = i;
                tokenCount++;
            }
        }

        uint256[] memory forSaleTokenIds = new uint256[](tokenCount);
        for (uint256 i = 0; i < tokenCount; i++) {
            forSaleTokenIds[i] = tokenIds[i];
        }

        return forSaleTokenIds;
    }
}
